private func disconnectStream(_ error: NSError?, runDelegate: Bool = true) {
    if error == nil {
        writeQueue.waitUntilAllOperationsAreFinished()
    } else {
        writeQueue.cancelAllOperations()
    }
    cleanupStream()
    connected = false
    if runDelegate {
        doDisconnect(error)
    }
}

